import React from "react";
import { useGetFlightTypesQuery } from "../../redux/api/flightTypeApi";

const FlightTypeList = () => {
  const { data, isLoading } = useGetFlightTypesQuery();

  if (isLoading) return <p>Loading...</p>;

  return (
    <div className="mt-4">
      <h4>Flight Type List</h4>
      <table className="table table-bordered">
        <thead>
          <tr>
            <th>Name</th>
            <th>Capacity</th>
            <th>Description</th>
            <th>Max Speed</th>
            <th>Image</th>
          </tr>
        </thead>
        <tbody>
          {data?.flightTypes?.map((f) => (
            <tr key={f._id}>
              <td>{f.name}</td>
              <td>{f.capacity}</td>
              <td>{f.description}</td>
              <td>{f.maxSpeed}</td>
              <td>
                {f.image?.url && (
                  <img src={f.image.url} alt={f.name} width="100" height="60" />
                )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default FlightTypeList;
